import React from 'react';
import './App.css';
import Header from './Componentes/Header';
import HomePage from './Pages/HomePage';
import Sobre from './Pages/Sobre';

function App() {
  return ( <div>
    <Header  links={["Pagina Inicial","Sobre","Projetos","Habilidades","Contatos"]}></Header>
    <HomePage></HomePage>
    <Sobre></Sobre>

  </div>);
}

export default App;
